hare\""]},"metadata":{},"output_type":"display_data"}],"source":["# This R environment comes with many helpful analytics packages installed\n","# It is defined by the kaggle/rstats Docker image: https://github.com/kaggle/docker-rstats\n","# For example, here's a helpful package to load\n","\n","library(tidyverse) # metapackage of all tidyverse packages\n","\n","# Input data files are available in the read-only \"../input/\" directory\n","# For example, running this (by clicking run or pressing Shift+Enter) will list all files under the input directory\n","\n","list.files(path = \"../input\")\n","\n","# You can write up to 20GB to the current directory (/kaggle/working/) that gets preserved as output when you create a version using \"Save & Run All\" \n","# You can also write temporary files to /kaggle/temp/, but they won't be saved outside of the current session"]},{"cell_type":"markdown","id":"201a73c4","metadata":{"papermill":{"duration":0.014025,"end_time":"2022-05-04T03:59:19.496704","exception":false,"start_time":"2022-05-04T03:59:19.482679","status":"completed"},"tags":[]},"source":["## Data-driven decision-making\n","\n","Data-driven decision-making (DDDM) is defined as using facts, metrics,\n","and data to guide strategic business decisions that align with your goals, objectives, and initiatives.\n","Various of Data-driven decision-making process has been defined by Industry experts. There is no universal DDDM process but most of the DDDM follows the almost same process.\n","The method used in this project is Ask - Prepare - Process - Analyze - Share - Act ( APPASA )\n","\n","\n","## ASK\n","\n","\n","### Introduction\n","\n","In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime.\n","Until now, Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments.One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes,and annual memberships. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.\n","\n","Cyclistic’s finance analysts have concluded that annual members are much more profitable than casual riders. Although the pricing flexibility helps Cyclistic attract more customers, Moreno believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all-new customers, Moreno believes there is a very good chance to convert casual riders into members. She notes that casual riders are already aware of the Cyclistic program and have chosen Cyclistic for their mobility needs.\n","This data analysis has been done to obtain following :\n","\n","1. To know how annual members and casual riders use Cyclistic bikes differently?\n","\n","2. Why would casual riders buy Cyclistic annual memberships?\n","\n","3. How can Cyclistic use digital media to influence casual riders to become members?\n","\n","### Stakeholder \n","\n","Primary Stakeholder : Lily Moreno, Cyclistic executive team\n","\n","Secondary Stakeholder : Cyclistic marketing analytics team\n","\n","\n","\n","## PREPARE\n","\n","\n","### Data Set & Metadata\n","\n","\"divvy-tripdata\" is historical trip data of company Divvy and data has been made available  to public. Data set comes under [Divvy Data License Agreement](https://divvy-tripdata.s3.amazonaws.com/index.html) and it released monthly in schedule. The Data of Each trip is anonymized and includes:\n","Trip start day and time\n","Trip end day and time\n","Trip start station\n","Trip end station\n","Rider type (Member, Single Ride, and Day Pass)\n","Bike type (Classic bike, Docked bike, Electric bike)\n","\n","ROCCC analysis\n","\n","1. Reliable\n","\n","2. Original\n","\n","3. Comprehensive\n","\n","4. Current\n","\n","5. Cited\n","\n","Data set checks yes in all criteria of ROCCC analysis.\n","\n","All the data used in this analysis can be [downlaoded from here](https://divvy-tripdata.s3.amazonaws.com/index.html).\n","\n","\n","### Installing Required Packages\n","The packages used in this data analysis are :\n","tidyverse, dplyr, skimr, janitor, lubridate, readr\n","\n","and installed using :  install.packages(\"package_name\")"]},{"cell_type":"code","execution_count":2,"id":"c52bc08f","metadata":{"execution":{"iopub.execute_input":"2022-05-04T03:59:19.555987Z","iopub.status.busy":"2022-05-04T03:59:19.527028Z","iopub.status.idle":"2022-05-04T03:59:30.777218Z","shell.execute_reply":"2022-05-04T03:59:30.775383Z"},"papermill":{"duration":11.268898,"end_time":"2022-05-04T03:59:30.779681","exception":false,"start_time":"2022-05-04T03:59:19.510783","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Warning message in install.packages(\"dplyr\"):\n","“installation of package ‘dplyr’ had non-zero exit status”\n"]}],"source":["install.packages(\"dplyr\")"]},{"cell_type":"code","execution_count":3,"id":"a0c186b0","metadata":{"execution":{"iopub.execute_input":"2022-05-04T03:59:30.812363Z","iopub.status.busy":"2022-05-04T03:59:30.810719Z","iopub.status.idle":"2022-05-04T03:59:40.628828Z","shell.execute_reply":"2022-05-04T03:59:40.626456Z"},"papermill":{"duration":9.836449,"end_time":"2022-05-04T03:59:40.631049","exception":false,"start_time":"2022-05-04T03:59:30.7946","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n"]}],"source":["install.packages(\"skimr\")"]},{"cell_type":"code","execu