etadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["All_trip_cleaned_v1 %>% group_by(month, member_casual, rideable_type) %>% summarize(average_ride_duration = mean(ride_duration), .groups = 'drop') %>% drop_na() %>% ggplot(aes(x = month, y = average_ride_duration, fill = member_casual)) + geom_col(position = \"dodge\") + scale_y_continuous(labels = scales::comma) + facet_grid(member_casual~rideable_type) + labs(title = \"Average Ride duration by Month\") + theme(axis.text.x = element_text(angle = 90))"]},{"cell_type":"markdown","id":"c52966f2","metadata":{"papermill":{"duration":0.027952,"end_time":"2022-05-04T04:04:08.452406","exception":false,"start_time":"2022-05-04T04:04:08.424454","status":"completed"},"tags":[]},"source":["## Conclusion\n","\n","The sole purpose of this data analysis is to design a marketing strategies to convert casual rider into member rider by using digital media and to perform data analysis using Data driven decision making process : Ask - Prepare - Process -  Analyze - Share - Act. \n","\n","### Summary of data analysis result\n","\n","1.  Number of rides of Casual rider is higher On Saturday & Sunday,\n","    Number of rides of Member rider is higher from Monday to Friday.\n","\n","2.  Average ride duration of Casual rider is almost double compared to Member rider       type on any given day of week. \n","\n","3.  In any given month of calender the Average ride duration of Casual rider is almost     double of Member rider type.\n","\n","4.  In last 12 months the Ride percentage of Rider type was\n","    Casual Rider : 44 %\n","    Member Rider : 56 %\n","\n","5.  In last 12 months the Bike preference type of rider was\n","    Classic  Bike : 57%\n","    Electric Bike : 38%\n","    Docked Bike   : 5%\n","    \n","6. Docked bike is only Preferred by casual member\n","\n","### Based on analysis my 3 key recommendation are :\n","\n","1. Design a digital marketing campaign to offer discount on Membership and start         running campaign since Thursday and end it on Saturday morning.\n","\n","2. Design a digital marketing campaign (Video or series of posts) to educate :\n","   How using Cyclist user can avoid heavy traffic,\n","   Health benefit of using a bike over other commuting option,\n","   Emission free commute and user's contribution toward Environment.\n","   \n","   as well as keeping user Interest toward Membership.\n","   \n","3. Design a marketing campaign for local business for choosing Cyclist as their          commuting partner, showing advantages compared to other commuting options.\n","\n","\n","### Future Scope\n","\n","Further analysis of Geometric coordinate, Ride distance analysis, Ride route preferences as well as Regression can be done to further enhance the result.\n","\n","Survey can be conducted on Casual rider to understand more about user and can be mixed survey data with this analysis to increase effectiveness of marketing camping.\n","\n","\n","## Data-driven decision-making\n","\n","This data analysis follows : Ask - Prepare - Process -  Analyze - Share - Act.\n","We followed Ask- Prepare - Process - Analyze as well as created effective visualization and make recommendation.\n","\n","## Share & Act\n","To share my visualization, key finding and Recommendation I will make power point presentation, and ask time from stakeholder to present my findings.\n","\n","Its up to Stakeholder's to accept my recommendation & finding to Act upon them."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":293.695969,"end_time":"2022-05-04T04:04:08.80138","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-05-04T03:59:15.105411","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}